import React from 'react';
import styled from 'styled-components';

import charlyImg from '../../assets/images/charlyrenk-tuba.png';

const Container = styled.div`
	margin: auto;
`;

const Image = styled.img`
	text-align: right;
`;

const hero = (props) => (
	<Container>
		<Image src={charlyImg} alt="Charly Renk" />
	</Container>
)

export default hero;
